import React from "react";
import "./header.css";
import people from "../../assets/people.png";
import ai from "../../assets/blog02.png";
import a1 from "../../assets/google.png";
import a2 from "../../assets/slack.png";
import a3 from "../../assets/atlassian.png";
import a4 from "../../assets/dropbox.png";
import a5 from "../../assets/shopify.png";

const Header = () => {
  return (
    <div className="container gpt3_header">
      <div className="row  gpt3_header-row ">
        <div className="col-md-7 gpt3_header-content align-items-start ">
          <h1>Letâ€™s Build Something amazing with GPT-3 OpenAI</h1>
          <p>
            Yet bed any for travelling assistance indulgence unpleasing. Not
            thoughts all exercise blessing. Indulgence way everything joy
            alteration boisterous the attachment. Party we years to order allow
            asked of.
          </p>
          <input type="search" name="" id="" />
          <button> get started</button>
          <div className="header_people">
            <img src={people} alt="" srcset="" />
            <span style={{ color: "white" }}>
              1,600 people requested access a visit in last 24 hours
            </span>
          </div>
        </div>
        <div className="col-md-5 gpt3_header-content_pic">
          <div className="header_content-img">
            <img src={ai} alt="" srcset="" />
          </div>
        </div>
      </div>
      <img src={a1} alt="" srcset="" />
      <img src={a2} alt="" srcset="" />
      <img src={a3} alt="" srcset="" />
      <img src={a4} alt="" srcset="" />
      <img src={a5} alt="" srcset="" />
      
    </div>
  );
};

export default Header;
